import React from 'react';
import './App.css';
/* router */
import { BrowserRouter as Router,Switch, Redirect,Route } from 'react-router-dom';
/* pages */
import Admin from './Features/Admin/Admin';

function App () {
  return (
    <Router>
      <div>
        <Switch >
          <Route path='/admin' key={ '1' }>
            <Admin></Admin>
          </Route>
          <Route path='/'key={ '2' }>
            <Redirect to='/admin/restaurant'></Redirect>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
